import React from "react";
import "./ControlPins.css";
import Config from "./Config";
import Video from "./Video"
class ControlPins extends React.Component {
  render() {
    return (
      <div id="flexbox-schema-video-stimulus">
        <Video />
        <Config />
      </div>
    );
  }
}
export default ControlPins;
